import React from 'react';
import './Cart.css';

const Cart: React.FC = () => {
    var message = 'Cart is showing!'

    const outputMessage = () => {
        var messages = []

        for (let i = 0; i < 5; i++) {
            messages.push(
                <h1> { message } </h1>
            )
        }

        return messages
    }

    return (
        <div id='Cart'>
            { outputMessage() }
        </div>
    )
}

export default Cart
